import { StatusBar } from 'expo-status-bar';
import React from 'react';

import {
  ScrollView, ImageBackground,
  Button,
  StyleSheet,
  Text,
  CheckBox,
  TextInput,
  TouchableOpacity,
  View,
  Image
} from 'react-native';

import { StackNavigator } from '@react-navigation/native';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';

//const [isSelected, setSelection] = useState(false);

const MyApp = () => {
  return (
    <ScrollView>
      <View style={styles.container}>
        <StatusBar style="auto" />
        <View style={{
          width: '100%',
          //flexDirection: 'row',
          justifyContent: 'center',
          //alignItems: 'center'
          }}>
          <Image style={{
            width: '100%',
            height: 200,
          }} resizeMode={'cover'} 
          source={require('../assets/14.5-Dental-Clinic-Services-Details/pic_service.png')} 
          />
          <View style={{
            width: '98%',
            flexDirection: 'row',
            }}>
            <Image
              style={{
                textAlign:'left',
                marginStart:10,
                width: 12,
                height: 12,
              }}
              resizeMode={'cover'}
              //source={require('./assets/13.2-3-5-Car-Service-Profile/clock_white.png')}
              />
              <Text style={{
                color:'#fff',
                marginStart:5,
                fontSize:12
                }}>
              10:00 am - 06:00 pm </Text>
            </View>
        </View>

      </View>
    </ScrollView>

  );

}

export default MyApp;

const styles = StyleSheet.create({
  container: {
    width: "100%",
    height: "100%",
    alignItems: 'center',
    justifyContent: 'center',
  },
  logo: {
    width: 66,
    height: 58,
  },
  buttonContainer: {
    width: "100%",
    flexDirection: 'row',
    alignItems: 'center',
    justifyContent: 'center',
    marginTop: 10,
    marginStart: 60,
  },
  checkboxContainer: {
    flexDirection: "row",
    marginBottom: 20,
  },
  textHeading: {
    fontSize: 18,
    marginBottom: 16,
    marginTop: 32,
    fontWeight: 'bold',
    textAlign: 'left',
    width: "94%",
  },
  textLabel: {
    textAlign: 'left',
    marginStart: 8,
    marginBottom: 8,
    color: '#4D4D4D',
    marginTop: 16,
    fontWeight: 'bold',
    width: "94%",
  },
  textInput: {
    height: 40,
    width: "94%",
    padding: 10,
    borderRadius: 4,
    borderColor: 'gray',
    backgroundColor: '#FFFFFF',
    borderWidth: 1,
  },
  textArea: {
    width: "94%",
    padding: 10,
    borderRadius: 4,
    borderColor: 'gray',
    backgroundColor: '#FFFFFF',
    borderWidth: 1,
    height: 150,
    justifyContent: "flex-start"
  }
});
